<?php	require_once ("../lib/common/dao/VO.class.php");	class Userorgaccesscontrol extends VO {		private $organizationVO;		private $userVO;		private $organizationid;		private $userid;		public function setOrganization($organizationVO){			$this->organizationVO=$organizationVO;		}		public function getOrganization(){			return $this->organizationVO;		}		public function setUser($userVO){			$this->userVO=$userVO;		}		public function getUser(){			return $this->userVO;		}		public function setOrganizationid($organizationid){			$this->organizationid=$organizationid;		}		public function getOrganizationid(){			return $this->organizationid;		}		public function setUserid($userid){			$this->userid=$userid;		}		public function getUserid(){			return $this->userid;		}		public function __toString(){			return "organizationid=".$this->organizationid."(".$this->organizationVO.")".", userid=".$this->userid."(".$this->userVO.")";		}	}?>